import React from 'react';
import { Route,  BrowserRouter } from 'react-router-dom';
import Home from '../src/containers/Home';


const Router = () => {
    return (
        <>
            <BrowserRouter>
                <Route exact path={'/'} element=<Home/> />
            </BrowserRouter>
        </>
    );
};
export default Router;
